import React from "react";
import bnbimg from "../Images/binance.jpg";
import "./Buyer.css";

function Buy () {
    return(
        <div className="container-buy">
            <p class="whereto">Where to buy cryptocurrencies?</p>
            <div className="binancedesc">
            <a href="https://www.binance.com" target="_blank" className="bnbimg"><img src={bnbimg} alt="" /></a>
            <ul className="binancedescp"> Why binance?
                <li>
                Binance Exchange is the largest crypto exchange by trade volume and one of the fastest in the world.
                </li>
            </ul>
            </div>
            
        </div>
    );
}

export default Buy;
